import 'package:flutter/material.dart';
import 'package:qrcode_recognition/qrcode_recognition.dart';

void main() {
  runApp(const MyApp());
}

class MyApp extends StatelessWidget {
  const MyApp({Key? key}) : super(key: key);

  // This widget is the root of your application.
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      title: 'qrcode recognition',
      theme: ThemeData(
        primarySwatch: Colors.blue,
      ),
      home: const MyHomePage(title: 'Qrcode Recognition'),
    );
  }
}

class MyHomePage extends StatefulWidget {
  const MyHomePage({Key? key, required this.title}) : super(key: key);

  final String title;

  @override
  State<MyHomePage> createState() => _MyHomePageState();
}

class _MyHomePageState extends State<MyHomePage> {
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text(widget.title),
      ),
      body: Center(
        child: Column(
          mainAxisAlignment: MainAxisAlignment.center,
          children: [
            TextButton(
              onPressed: () async {
                final data = await QrcodeRecognition.recognition(
                    "https://img1.baidu.com/it/u=2877499757,3239316825&fm=224&fmt=auto&gp=0.jpg");
                print(data);
              },
              child: Text(
                "Recognition HTTP/HTTPS URL",
                style: TextStyle(
                  color: Colors.blue[400],
                ),
              ),
            ),
            TextButton(
              onPressed: () async {
                final data = await QrcodeRecognition.recognition(base64String);
                print(data);
              },
              child: Text(
                "Recognition base64 string",
                style: TextStyle(
                  color: Colors.blue[400],
                ),
              ),
            )
          ],
        ),
      ),
    );
  }

  String base64String =
      '';
}
